import Company_Logo from './files_to_modify/logo.png';

export default function Logo() {
    return(
        <div>
            <img src={Company_Logo} style={styles.logo} alt="logo" />
        </div>
    )
 }

 const styles = StyleSheet.create({
    logo: {
      alignItems: 'center',
      justifyContent: 'center',
    },
  });
